import React from "react";
import {BiMenu} from "react-icons/bi";
import styled from "styled-components";

const NavbarMobileWrapper = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 5px 10px;
  width: 100%;
  height: 50px;
  background: #3E2723;
  color: #FFFFFF;
`;

const NavbarMobile = () => (
    <>
        <NavbarMobileWrapper>
            <BiMenu />
        </NavbarMobileWrapper>
    </>
);

export default NavbarMobile;
